import React from 'react';



function Pic (props){

  return <img key = {props.pokemonkey} alt='poke' src={`https://pokeres.bastionbot.org/images/pokemon/${props.pokemonkey}.png/`} 
		 onClick = {(e)=>props.clickFunction(e,props.pokemonkey)}
		 onKeyDown={props.escape} />


}













export default Pic;
